import React from'react'
import ReactDOM from'react-dom'
import{Provider}from'react-redux'
import{store}from'./store/store'
import{Switch,Route,BrowserRouter,NavLink as Link}from'react-router-dom';import Counter from'./components/counter'


const Header=()=>(<header><nav><ul><li><Link to='/'>Home</Link></li><li><Link to='/roster'>Roster</Link></li><li><Link to='/schedule'>Schedule</Link></li><li><Link to='/Counter'>Counter</Link></li></ul></nav></header>)
const Roster=()=>(<div>asd</div>)
const Schedule=()=>(<div><ul><li>6/5@Evergreens</li><li>6/8 vs Kickers</li><li>6/14@United</li></ul></div>)
const Home=()=>(<div><h1>Welcome to the Tornadoes Website!</h1></div>)
const App=()=>(<div><Header/><Main/></div>)
ReactDOM.render(<Provider store={store}><BrowserRouter><App/></BrowserRouter></Provider>,document.getElementById('root'))